import { Component } from 'react';
import { getStates } from '../services/apiService';

class Home extends Component {
  constructor() {
    this.state = {
      ufs: [],
      isDark: false,
    };
  }

  componentDidMount() {
    this.loadStates();
  }

  loadStates = async () => {
    const ufs = await getStates();
    this.setState({
      ufs,
    });
  }

  render() { 
    const { ufs } = this.state;
    return (
      <h1>Home</h1>
    );
  }
}

export default Home;
